import java.util.ArrayList;

public class DayFive {
    static String input = "";

    static String almostFinishedPolymer;

    static boolean areUnitsDetroyable(String charOne, String charTwo) {
        boolean temp = false;

        if (charOne.equalsIgnoreCase(charTwo) && !charOne.equals(charTwo)) {
            temp = true;
        }
        return temp;
    }

    static String iterateAndRemoveChar(String exepctedPolymer) {
        String tempInput = exepctedPolymer;
        boolean isThatTheFinalVersionOfTheString = false;

        while (!isThatTheFinalVersionOfTheString) {
            for (int i = 0; i < tempInput.length(); i++) {
                if (i == tempInput.length() - 1) {
                    isThatTheFinalVersionOfTheString = true;
                } else if (areUnitsDetroyable(String.valueOf(tempInput.charAt(i)), String.valueOf(tempInput.charAt(i + 1)))) {
                    StringBuilder builder = new StringBuilder(tempInput);
                    tempInput = builder.delete(i, i+2).toString();
                    break;
                }
            }
        }

        return tempInput;
    }

    static ArrayList<String> listOfCharacters() {
        almostFinishedPolymer = iterateAndRemoveChar(input);
        String almostFinishedPolymerToLowerCase = almostFinishedPolymer.toLowerCase();
        ArrayList<String> temp = new ArrayList<>();
        String theCharacter;

        for (int i = 0; i < almostFinishedPolymerToLowerCase.length(); i++) {
            theCharacter = almostFinishedPolymerToLowerCase.substring(i, i+1);
            if (!temp.contains(theCharacter)) {
                temp.add(theCharacter);
            }
        }
        return temp;
    }

    static void removeAllOccurencesOfSingleCharacter() {
        String tempPolymer;
        for (String character: listOfCharacters()) {
            tempPolymer = almostFinishedPolymer.replace(character, "");
            tempPolymer = tempPolymer.replace(character.toUpperCase(), "");

            System.out.println(iterateAndRemoveChar(tempPolymer).length());
            System.out.println("When removing character " + character + " the size of the polymer is: " + tempPolymer.length());
            System.out.println("====================");
        }
    }

    public static void dayFivePartOne() {
        System.out.println(iterateAndRemoveChar(input).length());
    }

    public static void dayFivePartTwo() {
        removeAllOccurencesOfSingleCharacter();
    }

    public static void main(String[] args) {
        dayFivePartTwo();
    }
}

